INSERT INTO `book` VALUES (1,'Ghosts of Spain: Travels Through Spain and its Silent Past','Giles Tremlett','Spaniards are reputed to be amongst Europe\'s most forthright people. So why have they kept silent about the terrors of their Civil War and the rule of General Franco? This apparent \'pact of forgetting\' inspired writer Giles Tremlett to embark on a journey around Spain and its history. He found the ghosts of Spain everywhere, almost always arguing. Who caused the Civil War? Why do Basque terrorists kill? Why do Catalans hate Madrid? Did the Islamist bombers who killed 190 people in 2004 dream of a return to Spain\'s Moorish past? Tremlett\'s curiosity led him down some strange and colourful byroads, and brought him unexpected insights into the Spanish character.',14,13,'History',_binary 'data:image/png;base64,'),(2,'Homage to Catalonia: George Orwell','George Orwell','\'Every line of serious work that I have written since 1936 has been written, directly or indirectly, against totalitarianism and for democratic Socialism as I understand it\'. Thus wrote Orwell following his experiences as a militiaman in the Spanish Civil War, chronicled in Homage to Catalonia. Here he brings to bear all the force of his humanity, passion and clarity, describing with bitter intensity the bright hopes and cynical betrayals of that chaotic episode: the revolutionary euphoria of Barcelona, the courage of ordinary Spanish men and women he fought alongside, the terror and confusion of the front, his near-fatal bullet wound and the vicious treachery of his supposed allies.',25,24,'Biography',_binary 'data:image/png;base64,'),(3,'The New Spaniards','John Hooper','\nA fully revised, expanded and updated edition of this masterly portrayal of contemporary Spain. The restoration of democracy in 1977 heralded a period of intense change that continues today. Spain has become a land of extraordinary paradoxes in which traditional attitudes and contemporary preoccupations exist side by side. Focussing on issues which affect ordinary Spaniards, from housing to gambling, from changing sexual mores to rising crime rates. John Hooper\'s fascinating study brings to life the new Spain of the twenty-first century.\n',10,9,'Politics',_binary 'data:image/png;base64,\\n'),(4,'Don Quijote de la Mancha (ES)','Miguel de Cervantes','Poco puede decirse del Quijote que no se haya dicho ya. Obra culmen de la literatura universal y primera novela moderna, Cervantes ideó la historia de un hidalgo aldeano que enloquece de tanto leer novelas de caballerías y, como buen caballero andante, sale a los caminos con el noble afán de ayudar a los necesitados. Así, en compañía del afable y crédulo Sancho Panza, don Quijote participa en una serie de delirantes aventuras que provocarán la hilaridad del lector, ya que la vida que reproduce Cervantes es alegre, graciosa y dramática, a la vez que sana y optimista, a pesar de las vicisitudes de su existencia. Sin embargo, el Quijote es mucho más, pues constituye una lección magistral sobre la grandeza y la miseria de la condición humana. La Real Academia Española y la Asociación de Academias de la Lengua Española conmemoran el IV Centenario de Don Quijote de la Mancha con la publicación de una edición de la obra de Miguel de Cervantes. El texto crítico y sus notas han sido preparados por Francisco Rico. El texto ha sido fijado a partir del examen de todas las ediciones significativas, antiguas y modernas, y con la aplicación de los métodos filológicos más rigurosos. Las notas aclaran todos los puntos que pueden plantear dudas al lector moderno y están redactadas siempre con la máxima claridad y del modo que más agiliza la lectura. Lo acompañan un extenso prólogo de Vargas Llosa, estudios generales de Martín de Riquer, Francisco Ayala; y el propio Francisco Rico y se cierra con otra serie de diversos artículos de importantes comentaristas y un glosario de 7.000 términos que ayudará al lector actual a conocer la lengua de Cervantes.\n',10,10,'Novel',_binary 'data:image/png;base64,\\n'),(5,'Don Quixote of La Mancha (EN)','Miguel de Cervantes','\nDon Quixote has become so entranced by reading romances of chivalry that he determines to become a knight errant and pursue bold adventures, accompanied by his squire, the cunning Sancho Panza. As they roam the world together, the aging Quixote\'s fancy leads them wildly astray, tilting at windmills, fighting with friars, and distorting the rural Spanish landscape into a fantasy of impenetrable fortresses and wicked sorcerers. At the same time the relationship between the two men grows in fascinating subtlety. Often considered to be the first modern novel, Don Quixote is a wonderful burlesque of the popular literature its disordered protagonist is obsessed with.\n',20,19,'Novel',_binary 'data:image/png;base64,\\n');
INSERT INTO `book` VALUES (6,'Driving Over Lemons','Chris Stewart','\nA funny, generous, wonderfully written account of a family making a life and home in remote but enchanting southern Spain—from the first drummer of the rock band Genesis. \n\nNo sooner had Chris Stewart set eyes on El Valero than he handed over a check.  Now all he had to do was explain to Ana, his wife, that they were the proud owners of an isolated sheep farm in the Alpujarra Mountains in Southern Spain. That was the easy part.\n\nLush with olive, lemon, and almond groves, the farm lacks a few essentials—running water, electricity, an access road.  And then there\'s the problem of rapacious Pedro Romero, the previous owner who refuses to leave.  A perpetual optimist, whose skill as a sheepshearer provides an ideal entrée into his new community, Stewart also possesses an unflappable spirit that, we soon learn, nothing can diminish.  Wholly enchanted by the rugged terrain of the hillside and the people they meet along the way—among them farmers, including the ever-resourceful Domingo, other expatriates and artists—Chris and Ana Stewart build an enviable life, complete with a child and dogs, in a country far from home.\n',20,20,'Biography',_binary 'data:image/png;base64,\\n'),(7,'Imperial Spain: 1469–1716','John Elliott','\nSince its first publication, J. H. Elliott\'s classic chronicle has become established as the most comprehensive, balanced, and accessible account of the dramatic rise and fall of imperial Spain.  Now with a new preface by the author, this brilliant study unveils how a barren, impoverished, and isolated country became the greatest power on earth—and just as quickly fell into decline.\nAt its greatest Spain was a master of Europe: its government was respected, its armies were feared, and its conquistadores carved out a vast empire. Yet this splendid power was rapidly to lose its impetus and creative dynamism. How did this happen in such a short space of time? Taking in rebellions, religious conflict and financial disaster, Elliott\'s masterly social and economic analysis studies the various factors that precipitated the end of an empire.\n',20,20,'History',_binary 'data:image/png;base64,\\n'),(8,'The Ornament of the World: How Muslims, Jews and Christians Created a Culture of Tolerance in Medieval Spain','Maria Rosa Menocal','\nThis classic bestseller — the inspiration for the PBS series — is an \'illuminating and even inspiring\' portrait of medieval Spain that explores the golden age when Muslims, Jews, and Christians lived together in an atmosphere of tolerance (Los Angeles Times). \n\nThis enthralling history, widely hailed as a revelation of a \'lost\' golden age, brings to vivid life the rich and thriving culture of medieval Spain, where for more than seven centuries Muslims, Jews, and Christians lived together in an atmosphere of tolerance, and where literature, science, and the arts flourished. \n\n\'It is no exaggeration to say that what we presumptuously call \'Western\' culture is owed in large measure to the Andalusian enlightenment...This book partly restores a world we have lost.\' —Christopher Hitchens, The Nation\n',10,10,'History',_binary 'data:image/png;base64,\\n'),(9,'The Spanish Holocaust: Inquisition and Extermination in Twentieth-Century Spain','Paul Preston','Long neglected by European historians, the unspeakable atrocities of Franco’s Spain are finally brought to tragic light in this definitive work.',15,15,'History',_binary 'data:image/png;base64,\\n');
INSERT INTO `book` VALUES (10,'The Shadow of the Wind','Carlos Ruiz Zafon','\n\nBarcelona, 1945: A city slowly heals in the aftermath of the Spanish Civil War, and Daniel, an antiquarian book dealer’s son who mourns the loss of his mother, finds solace in a mysterious book entitled The Shadow of the Wind, by one Julián Carax. But when he sets out to find the author’s other works, he makes a shocking discovery: someone has been systematically destroying every copy of every book Carax has written. In fact, Daniel may have the last of Carax’s books in existence. Soon Daniel’s seemingly innocent quest opens a door into one of Barcelona’s darkest secrets—an epic story of murder, madness, and doomed love.\n\n',10,10,'Novel',_binary 'data:image/png;base64,\\n'),(11,'The Sun Also Rises','Ernest Hemingway','\n\nThe Sun Also Rises is a classic example of Hemingway’s spare but powerful writing style. It celebrates the art and craft of Hemingway’s quintessential story of the Lost Generation—presented by the Hemingway family with illuminating supplementary material from the Hemingway Collection at the John F. Kennedy Library.\n\nA poignant look at the disillusionment and angst of the post-World War I generation, the novel introduces two of Hemingway’s most unforgettable characters: Jake Barnes and Lady Brett Ashley. The story follows the flamboyant Brett and the hapless Jake as they journey from the wild nightlife of 1920s Paris to the brutal bullfighting rings of Spain with a motley group of expatriates. It is an age of moral bankruptcy, spiritual dissolution, unrealized love, and vanishing illusions. First published in 1926, The Sun Also Rises is “an absorbing, beautifully and tenderly absurd, heartbreaking narrative...a truly gripping story, told in lean, hard, athletic prose” (The New York Times).\n\nThe Hemingway Library Edition commemorates Hemingway’s classic novel with a personal foreword by Patrick Hemingway, the author’s sole surviving son, and an introduction by Sean Hemingway, grandson of the author. Hemingway considered the extensive rewriting that he did to shape his first novel the most difficult job of his life. Early drafts, deleted passages, and possible titles included in this new edition elucidate how the author achieved his first great literary masterpiece.\n\n',12,12,'Novel',_binary 'data:image/png;base64,\\n'),(12,'The Back Room','Carmen Martin Gaite','\nIn the middle of the night, a woman awakens to find a stranger in her bedroom. Though she cannot determine who he is—or, indeed, whether he is even real at all and not just an extension of her dreams or her writing—she is drawn into a conversation with her unexpected guest. What she tells him becomes the story of a woman coming of age in the repressive Spain of the Franco era.\n\nIn The Back Room Carmen Martín Gaite spins out a hypnotic evocation of one woman\'s life counterpointed against the social history of modern Spain. The growth of a personal identity and the terrors of fascism are woven together within the delicate fabric of this dreamlike narrative. The result is an intimate and existential confessional—part autobiography, part fiction. In direct and simple language, Martín Gaite envisions life within a world besieged. This, her finest work, explores the back room of memory with a quiet but irresistible power.\n',20,20,'Novel',_binary 'data:image/png;base64,\\n');
